  false,\n\t\"url\": null,\n\t\"notes\": \"The aim of the project summarized in this
  report was to determine the feasibility of detecting change in surface water levels
  and associated wetland biomass at the Stillwater National Wildlife Refuge. This
  study sought to assess the potential for using Landsat thematic mapper (TM) imagery
  for detecting change in water levels and biomass at the Stillwater National Wildlife
  Refuge wetlands. It was shown that water level change can be quantitatively determined
  with great accuracy. Changes in biomass are more gradational than water level change
  but qualitative and spatial change can easily be shown. This study observed change
  over approximately four months or the changes from summer to fall.\",\n\t\"license_title\":
